import * as CryptoJS from 'crypto-js';
import * as utf8 from 'utf8';
import { ImageHelper } from './ImageHelper';

export class Hasher {
    
    public static getHash(base64: string, callback: any) {

        //obtem blob e binaryString
        var objBlob = ImageHelper.base64toBlob(base64, "");

        //gera hash a partir de binary string
        var hash = CryptoJS.MD5(CryptoJS.enc.Latin1.parse(objBlob.binaryString));
        var md5 = hash.toString(CryptoJS.enc.Hex).toUpperCase();

        //encode utf-8 base64
        let strEncoded = utf8.encode(base64);

        let res = { base64: strEncoded, hash: md5, size: objBlob.blob.size }
        callback(res);
    }

    public static getBase64Example() {
        return "";
    }
}